package p032

import "testing"

func testCase(in0 string, out0 int, t *testing.T) {
	out1 := longestValidParentheses(in0)
	if out0 != out1 {
		t.Errorf("Case %v: expected %v, got %v", in0, out0, out1)
	}
}

func TestLongestValidParentheses(t *testing.T) {
	in10  := "(()"
	out10 := 2
	testCase(in10, out10, t)

	in20  := ")()())"
	out20 := 4
	testCase(in20, out20, t)

	in30  := ")()(((())))("
	out30 := 10
	testCase(in30, out30, t)

	in40  := "))))((()(("
	out40 := 2
	testCase(in40, out40, t)

	in50  := "())"
	out50 := 2
	testCase(in50, out50, t)
}

